オートグリムは英国生まれのカーケア・ケミカル・ブランド。プロフェッショナル用として生まれ、自動車メーカーや磨き業者などの多くのプロから支持され続けてます。そのテクノロジーを惜しみなく投入したカーオーナー向け商品をご紹介します。 <br>シリコン、ワックス、研磨成分を一切含んでおらず吹き残しがありません。アクリル・プラスティック等には特にオススメです。また、塗装面にも使用でき、ビートや鳥の糞などのクリーニングにも安心してご使用いただけます。<br>■ウインドウ用クリーナー　　　■容量：500ml　　　■カープレミアムカーケアジャパン正規品 <br>ユニバーサル <br>　車検対応品<br>カーケア/ウィンドウケア<tr><td colspan="2">
